import React from 'react';
import DeleteTask from './DeleteTask';

const Task = ({ task, onDelete }) => {
  return (
    <div className='task'>
      <h3>
        {task.text} <DeleteTask onDelete={onDelete} task={task} />
      </h3>
    </div>
  );
};

export default Task;
